import React from 'react';
import './FoodDisplay.css';
import pizza from './pizza.jpeg';
import burger from './burger.jpeg';
import logo from './logo.png'; 
import sushi from './sushi.jpeg';
import pasta from './pasta.jpeg';
import salad from './salad.jpeg';
import steak from './steak.jpeg';
import tacos from './tacos.jpeg';
import sandwich from './sandwich.jpeg';
import ramen from './ramen.jpeg';
import dumplings from './dumplings.jpeg';
import fries from './fries.jpeg';
import iceCream from './icecream.jpeg';
import curry from './curry.jpeg';
import pancakes from './pancakes.jpeg';
import smoothie from './smoothie.jpeg';

const foodData = [
  { id: 1, name: 'Pizza', price: 10, imageUrl: pizza, section: 'Main Course', type: 'Veg' },
  { id: 2, name: 'Burger', price: 5, imageUrl: burger, section: 'Main Course', type: 'Non-Veg' },
  { id: 3, name: 'Sushi', price: 15, imageUrl: sushi, section: 'Main Course', type: 'Non-Veg' },
  { id: 4, name: 'Pasta', price: 12, imageUrl: pasta, section: 'Main Course', type: 'Veg' },
  { id: 5, name: 'Salad', price: 8, imageUrl: salad, section: 'Starters', type: 'Veg' },
  { id: 6, name: 'Steak', price: 20, imageUrl: steak, section: 'Main Course', type: 'Non-Veg' },
  { id: 7, name: 'Tacos', price: 9, imageUrl: tacos, section: 'Main Course', type: 'Veg' },
  { id: 8, name: 'Sandwich', price: 6, imageUrl: sandwich, section: 'Starters', type: 'Non-Veg' },
  { id: 9, name: 'Ramen', price: 14, imageUrl: ramen, section: 'Main Course', type: 'Veg' },
  { id: 10, name: 'Dumplings', price: 10, imageUrl: dumplings, section: 'Starters', type: 'Veg' },
  { id: 11, name: 'Fries', price: 4, imageUrl: fries, section: 'Starters', type: 'Veg' },
  { id: 12, name: 'Ice Cream', price: 7, imageUrl: iceCream, section: 'Desserts', type: 'Veg' },
  { id: 13, name: 'Curry', price: 13, imageUrl: curry, section: 'Main Course', type: 'Veg' },
  { id: 14, name: 'Pancakes', price: 8, imageUrl: pancakes, section: 'Desserts', type: 'Veg' },
  { id: 15, name: 'Smoothie', price: 5, imageUrl: smoothie, section: 'Desserts', type: 'Veg' },
];

const FoodDisplay = ({ addToCart, cart, onCheckout }) => {
  const totalAmount = cart.reduce((total, item) => total + item.price, 0);

  const renderFoodSection = (section) => (
    <div>
      <h2>{section}</h2>
      <ul className="food-list">
        {foodData
          .filter(food => food.section === section)
          .map(food => (
            <li key={food.id} className="food-item">
              <img src={food.imageUrl} alt={food.name} className="food-image" />
              <div className="food-details">
                <h3>{food.name}</h3>
                <p>Price: ${food.price}</p>
                <button onClick={() => addToCart(food)}>Add to Cart</button>
              </div>
            </li>
          ))}
      </ul>
    </div>
  );

  return (
    <div className="food-display-container">
      {/* Header Section */}
      <header className="header">
        <img src={logo} alt="Website Logo" className="logo" />
        <h1 className="website-name">YummyRoute</h1>
      </header>

      {/* Food Sections */}
      {renderFoodSection('Main Course')}
      {renderFoodSection('Starters')}
      {renderFoodSection('Desserts')}

      {/* Cart Section */}
      <h2>Your Cart</h2>
      <ul className="cart-list">
        {cart.map((item, index) => (
          <li key={index} className="cart-item">
            {item.name} - ${item.price}
          </li>
        ))}
      </ul>
      <h3>Total: ${totalAmount}</h3>
      <button onClick={onCheckout} disabled={cart.length === 0}>
        Checkout
      </button>
    </div>
  );
};

export default FoodDisplay;
